import iconSprite from "../../assets/images/iconSprite.svg";

type IconType = {
	iconId: string;
	width?: string;
	height?: string;
	viewBox?: string;
};

export function Icon(props: IconType) {
	return (
		<svg
			xmlns="http://www.w3.org/2000/svg"
			width="65"
			height="48"
			viewBox="0 0 65 48"
			fill="none"
		>
			<use xlinkHref={`${iconSprite}#${props.iconId}`} />
		</svg>
	);
}
